void exp(mpz_t result, mpz_t base, mpz_t exponent, mpz_t modulus) {
    mpz_t tmp_base, tmp_exponent;
    mpz_init(tmp_base);
    mpz_init(tmp_exponent);
    mpz_set(tmp_base, base);
    mpz_set(tmp_exponent, exponent);

    mpz_set_ui(result, 1);
   

    while (mpz_cmp(exponent, zero) > 0) {
        if(mpz_tstbit(exponent, 0)) {
            mpz_mul(result, result, base);
            mpz_mod(result, result, modulus);
        }
        mpz_div(exponent, exponent, two);
        mpz_mul(base, base, base);
        mpz_mod(base, base, modulus);
    }
    mpz_set(base, tmp_base);
    mpz_set(exponent, tmp_exponent);
    mpz_clear(tmp_base);
    mpz_clear(tmp_exponent);
}

void exp(mpz_t result, mpz_t base, mpz_t exponent) {
    mpz_t tmp_base, tmp_exponent;
    mpz_init(tmp_base);
    mpz_init(tmp_exponent);
    mpz_set(tmp_base, base);
    mpz_set(tmp_exponent, exponent);

    mpz_set_ui(result, 1);
   

    while (mpz_cmp(exponent, zero) > 0) {
        if(mpz_tstbit(exponent, 0)) {
            mpz_mul(result, result, base);
        }
        mpz_div(exponent, exponent, two);
        mpz_mul(base, base, base);
    }
    mpz_set(base, tmp_base);
    mpz_set(exponent, tmp_exponent);
    mpz_clear(tmp_base);
    mpz_clear(tmp_exponent);
}

void mult(mpz_t result, mpz_t multiplier, mpz_t multiplicand, mpz_t modulus) {
    mpz_mul(result, multiplier, multiplicand);
    mpz_mod(result, result, modulus);
}

void inverse(mpz_t result, mpz_t a, mpz_t b) {
    mpz_t b0, t, q, x0, x1, tmp_a, tmp_b;
    mpz_init(b0);
    mpz_init(t);
    mpz_init(q);
    mpz_init(x0);
    mpz_init(x1);
    mpz_init(tmp_a);
    mpz_init(tmp_b);

    mpz_set(b0, b);
    mpz_set(x0, zero);
    mpz_set(x1, one);
    mpz_set(tmp_a, a);
    mpz_set(tmp_b, b);

    if(mpz_cmp(b, one) == 0) {
        mpz_set(result, one);
        return;
    }

    while(mpz_cmp(tmp_a, one) > 0) {
        mpz_div(q, tmp_a, tmp_b);
        mpz_set(t, tmp_b);
        mpz_mod(tmp_b, tmp_a, tmp_b);
        mpz_set(tmp_a, t);
        mpz_set(t, x0);
        mpz_mul(result, q, x0);
        mpz_sub(x0, x1, result);
        mpz_set(x1, t);
    }
    if(mpz_cmp(x1, zero) < 0) 
        mpz_add(x1, x1, b0);
    mpz_set(result, x1);

    mpz_clear(b0);
    mpz_clear(t);
    mpz_clear(q);
    mpz_clear(x0);
    mpz_clear(x1);
    mpz_clear(tmp_a);
    mpz_clear(tmp_b);
}

void gcd(mpz_t result, mpz_t a, mpz_t b) {
    mpz_t tmp_b, r;
    mpz_init(r);
    mpz_init(tmp_b);
    mpz_set(tmp_b, b);
    mpz_set(result, a);

    while (mpz_cmp(tmp_b, zero) > 0) {
        mpz_mod(r, result, tmp_b);
        mpz_set(result, tmp_b);
        mpz_set(tmp_b, r);
    }
    mpz_clear(r);
    mpz_clear(tmp_b);
}

int char2int(char input)
{
  if(input >= '0' && input <= '9')
    return input - '0';
  if(input >= 'A' && input <= 'F')
    return input - 'A' + 10;
  if(input >= 'a' && input <= 'f')
    return input - 'a' + 10;
  throw std::invalid_argument("Invalid input string");
}

// This function assumes src to be a zero terminated sanitized string with
// an even number of [0-9a-f] characters, and target to be sufficiently large
std::vector<char> hex2bin(const std::string& hex) {
  std::vector<char> bytes;

  for (uint i = 2; i <= (hex.length()/2)*2; i+= 2) {
    std::string byteString = hex.substr(hex.length() - i, 2);
    char byte = (char) strtol(byteString.c_str(), NULL, 16);
    bytes.push_back(byte);
  }

  if(hex.length() % 2 == 1) {
    char byte = (char) strtol(hex.substr(0, 1).c_str(), NULL, 16);
    bytes.push_back(byte);
  }
  return bytes;
}

std::vector<char> readAllBytes(char const* filename) {
    ifstream ifs(filename, ios::binary|ios::ate);
    ifstream::pos_type pos = ifs.tellg();

    std::vector<char> result(pos);

    ifs.seekg(0, ios::beg);
    ifs.read(&result[0], pos);

    return result;
}


